Art. 3º - DETERMINAR à Gerência de Regularização de
Veículos/RENAVAM deste Departamento as seguintes providências:
I - Inserção dos caracteres “CL” ao final do VIN e da
numeração do motor no registro do veículo original;
II - Criação de novo registro no sistema RENAVAM para o
veículo original, com as mesmas informações do registro anterior,
exceto pelos caracteres “CL” nas 2 (duas) últimas posições do VIN
e da numeração do motor, gerando novo número do RENAVAM e
nova Placa de Identificação Veicular - PIV;
III - Realização de novo emplacamento do veículo original,
com a nova PIV;
IV - Retirada dos dados do proprietário do registro cujo
VIN termine em CL, incluindo no campo relativo à propriedade a
expressão “registro de veículo clone”;
V - Anotação a restrição administrativa “Registro de
veículo clone” no registro cujo VIN termine com CL;
VI - Realização a “baixa por clonagem” do registro do
veículo cujo VIN termine em CL;
VII - Comunicação o DENATRAN acerca da substituição
dos caracteres alfanuméricos das placas de identificação veicular e
troca da placa do veículo;

